import React from "react"
import { ReactDOM } from "react"
import UseFetchExchange2 from "./useFetchExchange2";

export default function TestFetch() {

    const data = UseFetchExchange2('https://openexchangerates.org/api/latest.json?app_id=01341f5261444649a612793df73c7130')
    console.log('test: ' + data);

    return (
        <>
            <h1>{data}</h1>
            <ul>
                {data &&
                    <p>{data.base}</p>
                }
            </ul>
        </>
    )
}
